import React from 'react';
import PropTypes from 'prop-types';

function MealChart({ patientId, data, viewMode = 'patient', isExpanded = false }) {
  const mealData = data?.mealData || [];

  if (!mealData.length) {
    return (
      <div className="chart-placeholder">
        <p>No meal data available for {patientId}</p>
      </div>
    );
  }

  return (
    <div className="meal-chart">
      <div className="chart-content" style={{ height: isExpanded ? 450 : 300 }}>
        <p>Meal Chart - {mealData.length} meal entries</p>
        <p>Chart implementation coming soon...</p>
      </div>
    </div>
  );
}

MealChart.propTypes = {
  patientId: PropTypes.string.isRequired,
  data: PropTypes.object.isRequired,
  viewMode: PropTypes.oneOf(['patient', 'physician']),
  isExpanded: PropTypes.bool
};

export default MealChart;
